import './App.css';
import { 
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from 'react-router-dom'
import Home from './container/UTS/Home';
import MesinCuciPost from './container/UTS/MesinCuciPost';
import 'bootstrap/dist/css/bootstrap.min.css';
import CartPost from './container/UTS/CartPost';
import About from './container/UTS/About';
import {FaShoppingCart} from 'react-icons/fa';


function App() {
  return (
    <Router>
        <div>
          <nav className="navbar navbar-expand-lg navbar-light bg-light">
          <ul className="navbar-nav mr-auto">
            <li><Link to={'/'} className="nav-link"> Home </Link></li>
            <li><Link to={'/product'} className="nav-link"> Products </Link></li>
            <li><Link to={'/cart'} className="nav-link"><FaShoppingCart/></Link></li>
            <li><Link to={'/about'} className="nav-link">About</Link></li>
          </ul>
          </nav>
          <br />
          <Switch>
              <Route exact path='/' component={Home} />
              <Route path='/cart' component={MesinCuciPost} />
              <Route path='/cart' component={CartPost} />
              <Route path='/about' component={About} />
          </Switch>
        </div>
      </Router>
  );
}

export default App;
